import React from "react";
import PropTypes from "prop-types";
import { withStyles } from "@material-ui/core/styles";
import Typography from "@material-ui/core/Typography";
import Popover from "@material-ui/core/Popover";
import ClearIcon from "@material-ui/icons/Clear";
import TextField from "@material-ui/core/TextField";
import CheckIcon from "@material-ui/icons/Check";
import { Divider, IconButton } from "@material-ui/core";
import LabelIcon from "@material-ui/icons/Label";
import { DisplayAllLabel, addLabel } from "./Service";
import { typography } from "@material-ui/system";
import EditOutlinedIcon from "@material-ui/icons/EditOutlined";
import  editshowordelete from './Component/editshowordelete'
import Button from "@material-ui/core/Button";
import Dialog from "@material-ui/core/Dialog";
import DialogActions from "@material-ui/core/DialogActions";
import DialogContent from "@material-ui/core/DialogContent";
import DialogContentText from "@material-ui/core/DialogContentText";
import DialogTitle from "@material-ui/core/DialogTitle";

class AlertDialog extends React.Component {
  state = {
    open: false
  };

  handleClickOpen = () => {
    this.setState({ open: true });
  };

  handleClose = () => {
    this.setState({ open: false });
  };

  render() {
    return (
      <div>
        <div onClick={this.handleClickOpen}>Edit labels</div>

        <Dialog open={this.state.open} onClose={this.handleClose}>
          <Typography className={classes.typography}>
            <div
              style={{
                display: "flex",
                justifyContent: "space-around",
                flexDirection: "column",
                width: "129%"
              }}
            >
              <div>
                <b>Edit Labels</b>
              </div>
              <div
                style={{
                  display: "flex",
                  justifyContent: "space-around",
                  flexDirection: "row"
                }}
              >
                <Tooltip title="Cancel">
                  <ClearIcon style={{ paddingTop: "10px" }} />
                </Tooltip>
                <TextField
                  id="standard-dense"
                  placeholder="Create new label"
                  margin="dense"
                  style={{ paddingLeft: "5%" }}
                  onChange={this.Handlelabeldata}
                />
                <Tooltip title="Create label">
                  <CheckIcon
                    style={{ paddingLeft: "5%", paddingTop: "10px" }}
                    onClick={this.handleClickCreatelabel}
                  />
                </Tooltip>
              </div>
              <div>
                {this.state.allLable.map(label => (
                  <div
                    style={{
                      display: "flex",
                      justifyContent: "space-between",
                      paddingTop: "5%",
                      paddingBottom: "5%"
                    }}
                  >
                    <span>
                      <editshowordelete
                        deleteidprops={label.id}
                        refresh={this.getAllLabel}
                      />
                    </span>
                    <span style={{ paddingTop: "5%" }}>
                      {label.lable_title}
                    </span>
                    <Tooltip title="Rename label">
                      <EditOutlinedIcon style={{ paddingTop: "5%" }} />
                    </Tooltip>
                  </div>
                ))}
              </div>
              <Divider />
              <div
                style={{
                  display: "flex",
                  justifyContent: "flex-end",
                  paddingTop: "5%"
                }}
                onClick={this.handleClose}
              >
                Done
              </div>
            </div>
          </Typography>
        </Dialog>
      </div>
    );
  }
}

export default AlertDialog;
